$(function () {

    

    if ($('#balanceCounter').length) {

        targetDate(parseTime());

        $('#balanceCounter').countDown({
            targetDate: parseTime(),
            omitWeeks: true
        });
    }

// Get Day and Month end of countdown
    function targetDate(obj) {
        /*
         * @param {object}
         */
        var arrMonth = ['Января', 'Февраля', 'Марта', 'Апреля', 'Мая', 'Июня', 'Июля', 'Августа', 'Сентября', 'Октября', 'Ноября', 'Декабря'];

        $('#countdown-date').text(obj.day);
        $('#countdown-month').text(arrMonth[obj.month - 1]);
    }

// Отсчет с понедельника по воскресенье
    function parseTime() {
        var date = new Date(),
            dateDate = date.getDate(),
            dateDay = date.getDay(),
            obj = {};

        date.setDate((dateDay !== 0) ? dateDate + (7 - dateDay) : dateDate);

        obj.day = date.getDate();
        obj.month = date.getMonth() + 1;
        obj.year = date.getFullYear();

        obj.hour = 23;
        obj.min = 59;
        obj.sec = 59;

        return obj;
    }

    


});

/**
 * Выбор цветов окна рамы и ручек
 */
var ChoseColorWindow = function (container) {
    var
        $container,
        $frame,
        $handle;

    var changeFrameColor = function (e) {
        var
            $el = $(e.target),
            color = $el.data('color'),
            toggle = $el.data('toggle');

        if (color) {
            var
                src = $frame.attr('src').split('/'),
                newSrc;

            src[src.length - 1] = 'frame-' + color + '.png';
            newSrc = src.join('/');

            $frame.attr('src', newSrc);

            $container.find('.active[data-toggle="' + toggle + '"]').removeClass('active');
            $el.addClass('active');
        }
    };

    var changeFrameHandle = function (e) {
        var
            $el = $(e.target),
            handle = $el.data('handle'),
            toggle = $el.data('toggle');

        if (handle) {
            var
                src = $handle.attr('src').split('/'),
                newSrc;

            src[src.length - 1] = 'handle-' + handle + '.png';
            newSrc = src.join('/');

            $handle.attr('src', newSrc);

            $container.find('.active[data-toggle="' + toggle + '"]').removeClass('active');
            $el.addClass('active');
        }
    };

    var events = function () {
        $(document.body)
            .on('click', '[data-toggle="choose-color"]', changeFrameColor.bind(this))
            .on('click', '[data-toggle="choose-handle"]', changeFrameHandle.bind(this));
    };

    var initialisation = function (container) {
        $container = $(container);

        if (!$container.length) {
            return false;
        }

        $frame = $container.find('[data-type="frame"]');
        $handle = $container.find('[data-type="handle"]');


        events();

    };

    return {
        init: function () {
            initialisation(container);
        }
    }
};

